import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <aside className="sidebar">
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/latest-news">Latest News</Link>
            </li>
            <li>
              <Link to="/get-advise">Get Advise</Link>
            </li>
            <li>
              <Link to="/get-your-case">Get your case</Link>
            </li>
            <li>
              <Link to="/my-pay">My Pay</Link>
            </li>
            <li>
              <Link to="/settings">Settings</Link>
            </li>
            <li>
              <Link to="/log-out">Log Out</Link>
            </li>
          </ul>
        </aside>

        <main className="content">
          <Route exact path="/" component={Home} />
          <Route path="/latest-news" component={LatestNews} />
          <Route path="/get-advise" component={GetAdvise} />
          <Route path="/get-your-case" component={GetYourCase} />
          <Route path="/my-pay" component={MyPay} />
          <Route path="/settings" component={Settings} />
          <Route path="/log-out" component={LogOut} />
        </main>
      </div>
    </Router>
  );
}

function Home() {
  return <h2>Home</h2>;
}

function LatestNews() {
  return <h2>Latest News</h2>;
}

function GetAdvise() {
  return <h2>Get Advise</h2>;
}

function GetYourCase() {
  return <h2>Get your case</h2>;
}

function MyPay() {
  return <h2>My Pay</h2>;
}

function Settings() {
  return <h2>Settings</h2>;
}

function LogOut() {
  return <h2>Log Out</h2>;
}

export default App;
